function fetchPublicOrgRepoNames({ORG_NAME='', REPOS_PER_PAGE=100, PAGE=1}){
  return fetch(`https://api.github.com/orgs/${ORG_NAME}/repos?per_page=${REPOS_PER_PAGE}&page=${PAGE}`, {
    headers: new Headers({
      "Accept": "application/vnd.github.v3+json"
    })
  })
}

input.repos = await fetchPublicOrgRepoNames(input).then(res => res.json());
input.reposThisYear = input.repos.filter(repo => {
  return new Date(repo.updated_at).getUTCFullYear() === 2023
})
